import React from "react"

class LoadButton extends React.Component {
    render() {
        return(
            <div class="col text-center">
                <button id="load-more-photos" 
                    onClick={(e) => {
                        e.preventDefault(); 
                        this.props.handleShowMore
                    }}
                >
                    HUNGRY FOR MORE
                </button>
            </div>
        )
    }
}

export default LoadButton
